CREATE TABLE movies(
   _id        VARCHAR(24) NOT NULL PRIMARY KEY
  ,Rated      VARCHAR(9) NOT NULL
  ,Response   VARCHAR(4) NOT NULL
  ,Poster     VARCHAR(145) NOT NULL
  ,Title      VARCHAR(56) NOT NULL
  ,Actors     VARCHAR(77) NOT NULL
  ,imdbID     VARCHAR(9) NOT NULL
  ,Runtime    VARCHAR(7) NOT NULL
  ,imdbRating VARCHAR(3) NOT NULL
  ,Genre      VARCHAR(31) NOT NULL
  ,Language   VARCHAR(66) NOT NULL
  ,Director   VARCHAR(73) NOT NULL
  ,Metascore  VARCHAR(3) NOT NULL
  ,Released   VARCHAR(11) NOT NULL
  ,Awards     VARCHAR(67) NOT NULL
  ,Type       VARCHAR(6) NOT NULL
  ,Writer     VARCHAR(267) NOT NULL
  ,imdbVotes  VARCHAR(7) NOT NULL
  ,Country    VARCHAR(40) NOT NULL
  ,Box_office VARCHAR(11)
);
